import React, {Component} from 'react';
import '../App.css';
import {Navbar, Nav, Container} from 'react-bootstrap';
import {AiOutlineHome, AiOutlineUser, AiOutlineExport} from 'react-icons/ai';

export default class MyNav extends Component {
    render(){

        return(
        <div className='navbar w-100'>
            <Navbar variant="light">
                <Container>
                    {/* <Nav className="me-auto">
                        <Navbar.Brand className='navTitle' href="/">My_Events</Navbar.Brand>
                        <Nav.Link className='icon-home' href="/"><AiOutlineHome/></Nav.Link>
                        <Nav.Link className='icon-user' href="/profil"><AiOutlineUser/></Nav.Link>
                        <Nav.Link className='icon-log' href="/login"><AiOutlineExport/></Nav.Link>
                    </Nav> */}

                <Navbar bg="light" variant="light">
                    <Container>
                    <Navbar.Brand className='navTitl' href="/">My_Events</Navbar.Brand>
                        <Nav className="me-auto">
                            <Nav.Link className='icon-hoe' href="/"><AiOutlineHome/></Nav.Link>
                            <Nav.Link className='icon-usr' href="/profil"><AiOutlineUser/></Nav.Link>
                            <Nav.Link className='icon-lo' href="/login"><AiOutlineExport/></Nav.Link>
                        </Nav>
                    </Container>
                </Navbar>
                    {/* <SearchBar/> */}
                </Container>
            </Navbar>
        </div>

        )
    }
}
